import React, {Component} from 'react';
import styled from 'styled-components';

const Container = styled.div`{
    max-width: 1980px;
    padding-right: 15px;
    padding-left: 15px;
    marging-right: auto;
    marging-left: auto;
    box-sizing: border-box;
    &:before,
    &:after{
        content: " ";
    display: table;
    }
    &:after{
        clear: both;
    }
}
`;

export default Container;
